import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import MenuDrawer from './MenuDrawer'; // Import the MenuDrawer component

function Header() {
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  // Dummy search options for autocomplete
  const searchOptions = ['Apple', 'Microsoft', 'Google'];

  const handleDrawerOpen = () => {
    setIsDrawerOpen(true);
  };

  const handleDrawerClose = () => {
    setIsDrawerOpen(false);
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <IconButton
          size="large"
          edge="start"
          color="inherit"
          aria-label="open drawer"
          onClick={handleDrawerOpen}
          sx={{ mr: 2 }}
        >
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          Navbar scroll
        </Typography>
        <Autocomplete
          freeSolo
          options={searchOptions}
          renderInput={(params) => (
            <TextField {...params} label="Search stocks" variant="outlined" />
          )}
          sx={{ width: 300, marginRight: 2 }}
        />
        <Button variant="outlined" color="inherit" component={Link} to="/login">
          Login
        </Button>
        <Button variant="outlined" color="inherit" component={Link} to="/register">
          Register
        </Button>
        <MenuDrawer isOpen={isDrawerOpen} onDrawerClose={handleDrawerClose} />
      </Toolbar>
    </AppBar>
  );
}

export default Header;
